  `foreign_name` varchar(100) DEFAULT NULL,
  `material_type` int(11) DEFAULT NULL,
  `brand` varchar(200) DEFAULT NULL,
  `specifications_model` varchar(300) DEFAULT NULL,
  `season` varchar(20) DEFAULT NULL,
  `is_purchase` bit(1) DEFAULT b'1',
  `is_sell` bit(1) DEFAULT b'0',
  `is_inventory` bit(1) DEFAULT b'1',
  `unit_id` int(11) NOT NULL,
  `barcode` varchar(20) DEFAULT NULL,
  `shops` varchar(11) DEFAULT NULL,
  `is_batch` bit(1) NOT NULL,
  `expiration_date` int(11) DEFAULT NULL,
  `partner_id` int(11) DEFAULT NULL,
  `min_order` int(11) DEFAULT NULL,
  `min_inventory` int(11) DEFAULT NULL,
  `max_inventory` int(11) DEFAULT NULL,
  `is_enable` bit(1) NOT NULL,
  `description` varchar(200) DEFAULT NULL,
  `is_delete` bit(1) NOT NULL,
  `transaction_id` varchar(13) DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `create_by` int(11) DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `update_by` int(11) DEFAULT NULL,
  `declare_unit` int(11) DEFAULT NULL COMMENT '申报单位',
  `legal_unit` int(11) DEFAULT NULL COMMENT '法定单位',
  `legal_translation_quantity` float(11,2) DEFAULT NULL COMMENT '法定折算数量',
  `entry_unit` int(11) DEFAULT NULL COMMENT '入区单位',
  `entry_translation_quantity` float(11,2) DEFAULT NULL COMMENT '入区折算数量',
  `manufacturer` varchar(100) DEFAULT NULL COMMENT '生产商',
  `provenance` varchar(100) DEFAULT NULL COMMENT '原产地',
  `ebec` varchar(100) DEFAULT NULL COMMENT '电商企业代码',
  `eben` varchar(100) DEFAULT NULL COMMENT '电商企业名称',
  `hscode` varchar(100) DEFAULT NULL COMMENT 'hs编码',
  `post_tax_number` varchar(100) DEFAULT NULL COMMENT '行邮税税号',
  `custom1` varchar(255) DEFAULT NULL,
  `custom2` varchar(255) DEFAULT NULL,
  `custom3` varchar(255) DEFAULT NULL,
  `item_no` varchar(100) DEFAULT NULL COMMENT '项号',
  `weight` decimal(50,6) DEFAULT NULL,
  `post_tax_rate` decimal(10,6) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `material_material_no_index` (`material_no`) USING BTREE,
  KEY `material_materia_type_index` (`material_type`) USING BTREE,
  KEY `material_barcode_index` (`barcode`) USING BTREE,
  KEY `material_is_enable_index` (`is_enable`) USING BTREE,
  KEY `material_is_delete_index` (`is_delete`) USING BTREE,
  KEY `material_is_batch_index` (`is_batch`) USING BTREE,
  KEY `material_transaction_id_index` (`transaction_id`) USING BTREE,
  KEY `material_unit_id_index` (`unit_id`) USING BTREE,
  KEY `material_partner_id_index` (`partner_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2043 DEFAULT CHARSET=utf8;

